import React, { useState } from "react";
import axios from 'axios';
import { useNavigate, Link } from "react-router-dom";
import './Register.css';

function Register() {
  const navigate = useNavigate();
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [email, setEmail] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (password.length < 6) {
      setErrorMessage("Password must be at least 6 characters long");
      return;
    }

    const details = { username, password, email };
    setLoading(true);
    setErrorMessage('');

    try {
      const res = await axios.post('http://localhost:3500/api/auth/register', details);
      console.log('Response:', res.data);
      alert('Form submitted successfully');
      setUsername('');
      setEmail('');
      setPassword('');
      setLoading(false);
      setErrorMessage('');
      navigate('/login');
    } catch (err) {
      console.error('Error:', err);
      setLoading(false);
      if (err.response) {
        setErrorMessage(err.response.data.message || 'Server Error');
      } else if (err.request) {
        setErrorMessage('No response from server');
      } else {
        setErrorMessage('Error occurred while submitting');
      }
    }
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card shadow">
            <div className="card-body">
              <h2 className="text-center mb-4">Sign Up</h2>
              <form onSubmit={handleSubmit}>
                <div className="mb-3">
                  <label htmlFor="username" className="form-label">Username</label>
                  <div className="input-group">
                    <span className="input-group-text">
                      <img
                        src="https://th.bing.com/th/id/OIP.Huv6Jw8ptRGaoV7UGmcnYwHaHa?rs=1&pid=ImgDetMain"
                        alt="Username Icon"
                        style={{ width: '20px', height: '20px' }}
                      />
                    </span>
                    <input
                      type="text"
                      id="username"
                      className="form-control"
                      value={username}
                      onChange={(e) => setUsername(e.target.value)}
                      placeholder="Enter your username"
                      required
                    />
                  </div>
                </div>
                <div className="mb-3">
                  <label htmlFor="email" className="form-label">Email</label>
                  <input
                    type="email"
                    id="email"
                    className="form-control"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    placeholder="Enter your email"
                    required
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="password" className="form-label">Password</label>
                  <input
                    type="password"
                    id="password"
                    className="form-control"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    placeholder="Enter your password"
                    required
                  />
                </div>
                <div className="mb-3 form-check">
                  <input type="checkbox" className="form-check-input" id="rememberMe" />
                  <label className="form-check-label" htmlFor="rememberMe">Remember me</label>
                </div>
                <button type="submit" className="btn btn-primary w-100" disabled={loading}>
                  {loading ? 'Registering...' : 'Register'}
                </button>
              </form>
              <div className="mt-3 text-center">
                <Link to="/login" className="btn btn-link">Already have an account? Login</Link>
              </div>
              {errorMessage && <div className="alert alert-danger mt-3">{errorMessage}</div>}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Register;
